import { styles } from "../../login/loginStyles";
import { editStyles } from "../boardStyles";

function EditMenu(){
    return(
        <>
        <div style={editStyles}>
            <h2 style={styles.header}>New Column</h2>
            <h2 style={styles.header}>New Card</h2>
        </div>
        </>
    )
}

export default EditMenu;
